import { Button } from '@mui/material'
import React from 'react'
import { auth } from '../firebase'

function SignOut() {
    return (
        <div>
            <Button 
                onClick={() => auth.signOut()}
                style={{ color: "white", fontSize: "15px" }}
            >
                サインアウト
            </Button>
        </div>
    )
}

export default SignOut
